        195: (e) => {
            "use strict";
            e.exports =
                "\n\n\n\n## *Jackalope*\n## 2017\n\n### • Industrial Design,\n### • Visual Communication, Branding\n!(./images/jackalope.png)[1.7977]\nIn my final year of high school I took a subject called Visual Communication Design (VCD). As part of VCD we were given the assignment to develop and fulfill a brief for a fictional client. I gave myself the brief to design a series of smart home appliances for the made up company Jackalope and produce accompanying visual identity and advertising material. Below is a poster of a smart speakers I designed with the Jackalope logo in the corner. See more of this project on Behance.";
        },
        558: (e) => {
            "use strict";
            e.exports =
                "\n\n\n\n## *My Own Programming Language*\n## 2021\n\n### • Lexing & Tokenization, Syntactic Analysis,\n### • Parsing, Compiler & Interpreter Design\n\nFor a while now I have been fascinated by computer languages and when over the semester break, I had a bit of time on my hands, I decided to—as an academic exercise—design my own language. My language consists of two components; the recursive descent parser which first lexers and tokenizes the input before generating an abstract syntax tree (AST); and the interpreter which traverses the AST and produces the appropriate output.\n\nMy language currently includes features such as closures, lambda expressions, first class and pure functions, making it well-suited to functional programming. In addition to this I plan to add support for multithreading and a stronger type system plus optimizations for tail-call recursion. I am also experimenting with implementing a stack based virtual machine—bytecode interpreter—to run my language.";
        },
        607: (e) => {
            "use strict";
            e.exports =
                "\n\n\n\n## *Pavilion*\n## 2019\n\n### • VR, 3D Rendering,\n### • Parametric Design, Architecture\n!(./images/pavilion.png)[1.77777]\nAt university, in addition to my computer science subjects, I completed a number of architecture and design electives. In one of my favourite architecture subjects we had to design a pavilion using parametric tools and present it in VR with Unreal Engine. I programmatically modeled a magnetic field and extracted the field lines to inform the structure of my pavilion. I enjoyed this assignment so much I decided to extend myself and produce a number of 3D ray traced renders some of which are below. My design received first class honors and was exhibited in the Melbourne School of Design annual exhibition (MSDx).";
        },
        283: (e) => {
            "use strict";
            e.exports =
                "\n\n\n\n## *Project L*\n## 2015\n\n### • Game Dev,\n### • Design, 3D\n!(./images/project-l.png)[1.77777]\nOver the years I have made many games, with the screenshot below representing one of them from around 2015. Probably one of the more technically challenging games I have created, it was an open world sandbox written in Unity, where you could interact, move, rotate and scale the objects in the world to build anything you wanted.";
        },
        15: (e) => {
            "use strict";
            e.exports =
                "\n\n\n\n## *The Golden Pack*\n## 2012-13\n\n### • Design,\n### • Illustration\n!(./images/the-golden-pack.png)[1.3333]\nWhen I was 12 years old, I played a lot of Minecraft however, I was never very happy with the low resolution look of the game. I decided to remedy this by creating a texture pack, which is a file containing alternative looks or textures for the objects in the game. When I put my work online, after some refinement I received my first 1000 downloads. Spotting a business opportunity, I added ads to the download link. My texture pack was downloaded over 50,000 times, earning me over $1000.";
        },
